    if windll.kernel32.ResumeThread(process_info.hThread) == 0:
        logger.error(f"Error in ResumeThread: {FormatError(GetLastError())}")
        subprocess.run(f"taskkill /F /PID {pid}", creationflags=subprocess.CREATE_NO_WINDOW)
